import {PokemonRandom} from "./PokemonRandom";
import {BarreDeRecherche} from "./BarreDeRecherche";
import {ResultatRecherche} from "./ResultatRecherche";
import {Favoris} from "./Favoris";


export const Accueil = () => {
    return(
        <div className="App container-fluid">
            <PokemonRandom />
            <BarreDeRecherche />
            <div className="row">
                <div className="col-sm">
                    <ResultatRecherche />
                </div>
                <div className="col-sm">
                    <Favoris />
                </div>
            </div>
        </div>
    );
}
